    data: |
      SELECT + ( NULLIF ( cor0.col2, cor0.col0 ) ) / - cor0.col0 + + 66 AS col2 FROM tab2 cor0 GROUP BY cor0.col2, col0;
  - name: tab2

outputs:
  - name: q184.out
    data: |
      61
      66
      66
